                    <p class=""card-text"">
                        A face-lift (rhytidectomy) is a cosmetic surgical procedure to create a younger appearance in your face.<br />
                        The procedure can reduce the sagging or folds of skin on the cheeks and jawline and other changes in the shape of your face that occur with age.<br />
                        During a face-lift, a flap of skin on each side of the face is pulled back, and tissues below the skin are surgically altered to return the contour of the face to a more youthful shape.<br />
                        Before the flap is sutured closed, excess skin is removed.<br />
                        <br />
                        <b>Risks</b><br />
                        A face-lift surgery can cause complications.<br />
");
