                        Long-term or permanent complications, while rare, can cause significant changes in appearance.<br />
                        The risks include:<br />
                        <b>Hematoma</b><br />
                        A collection of blood (hematoma) under the skin that causes swelling and pressure is the most common complication of face-lift surgery.<br />
                        Hematoma formation, which usually occurs with 24 hours of surgery, is treated promptly with surgery to prevent damage to skin and other tissues.<br />
                        <b>Scarring</b><br />
                        Incision scars from a face-lift are permanent but typically concealed by the hairline and natural contours of the face and ear.<br />
                        Rarely, incisions can result in raised, red scars.<br />
                        Injections of a corticosteroid medica");
            WriteLiteral(@"tion or other treatments might be used to improve the appearance of scars.<br />
                        <b>Nerve injury</b><br />
                        Injury to nerves, while rare, can temporarily or permanently affect nerves that control sensation or muscles.<br />
                        Temporary paralysis of a select muscle, resulting in an uneven facial appearance or expression, or temporary loss of sensation can last a few months to a year.<br />
                        Surgical interventions may offer some improvement.
                        <b>Hair loss</b><br />
                        You might experience temporary or permanent hair loss near the incision sites.<br />
